SELECT DISTINCT
       INF_EST_AGE_INTEG_NM_RAZAO,
       INF_EST_AGE_INTEG_CNPJ,
       INF_EST_AGE_INTEG_CEP,
       INF_EST_AGE_INTEG_BAIRRO,
       INF_EST_AGE_INTEG_DSC_LOGRAD,
       INF_EST_AGE_INTEG_NR_LOGRAD,
       INF_EST_AGE_INTEG_COD_MUNIC,
       INF_EST_AGE_INTEG_UF
  FROM FUNCIONARIO
 WHERE INF_EST_AGE_INTEG_CNPJ IS NOT NULL
   AND INF_EST_AGE_INTEG_CNPJ <> '';